import { ThemeProvider } from "styled-components";
import { Button } from ".component/Button";
import "./index.css"; //webpack이 img, css 같은 정적 파일을 로딩할 수 있게 해준다.

function App() {
  return (
    <ThemeProvider
      theme={{
        colors: {
          main_color: "#74da24",
          active_color: "#de4382",
        },
      }}
    >
      <Button text="Login">button</Button>
      <Button text="Sign up">button</Button>
    </ThemeProvider>
  );
}

export default App;
